const lessons = [
    {naame: 'lesson 1. Introduction'},
    {name:'Lesson 2. Musical notation p.1'},
    {name:'Lesson 3. Musical notation p.2'},
    {name:'Lesson 4. Alterations'},
    {name:'lesson 5. Introduction'},
    {name:'Lesson 6. Musical notation p.1'},
    {name:'Lesson 7. Musical notation p.2'},
    {name:'Lesson 8. Alterations'},
    {name:'lesson 9. Introduction'},
    {name:'Lesson 10. Musical notation p.1'},
    {name:'Lesson 11. Musical notation p.2'},
    {name:'Lesson 12. Alterations'},
]

export function Lessons() {

    return (
        <>
        lessons.map((lesson) => {
            <div className='lesson'>{lesson.name}</div>
        })
    </>)
}
